import React, {useState} from 'react';
import './Button.css';

function Button({setInterviewInProgress}) {
  // const [value, setValue] = useState()
  return (
    <button onClick={setInterviewInProgress(false)}  type="button" className="custom-btn">
      Join Interview
    </button>
  );
}

export default Button;
